import { createRouter, createWebHashHistory } from "vue-router";
const ItWorks = {
  template: "<div>It works!</div>",
};
const routes = [
  {
    path: "/",
    name: "HomePage",
    component: ItWorks,
  },
  {
    path: "/about",
    name: "AboutPage",
    component: ItWorks,
  },
];

const history = createWebHashHistory();

const router = createRouter({
  history,
  routes,
});

export default router;
